// SPDX-License-Identifier: BUSL-1.1

pragma solidity ^0.8.20;
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../error/Errors.sol";
// import "../utils/PercentageMath.sol";
import "../utils/WadRayMath.sol";

import "./IPoolInterestRateStrategy.sol";
import "../utils/Printer.sol";

contract PoolInterestRateStrategy is IPoolInterestRateStrategy {
    using WadRayMath for uint256;
    uint8 public constant SLOPESIZE = 6;
    uint256 public constant BALANCE5000 = 5000*WadRayMath.RAY;
    uint256 public constant BALANCE10000 = 10000*WadRayMath.RAY;
    uint256 public constant BALANCE50000 = 50000*WadRayMath.RAY;
    uint256 public constant BALANCE500000 = 500000*WadRayMath.RAY;
    uint256 public constant BALANCE1000000 = 1000000*WadRayMath.RAY;

    struct InterestRateStrategyParams {
        uint256 optimalUsageRatio;
        uint256 rate0;
        uint256[] rateSlope1;
        uint256[] rateSlope2;
    }

    uint256 public immutable OPTIMAL_USAGE_RATIO;
    uint256 public immutable MAX_EXCESS_USAGE_RATIO;
    uint256 internal immutable _rate0;
    uint256[] internal _rateSlope1;
    uint256[] internal _rateSlope2;
    constructor(
        InterestRateStrategyParams memory params
    ) {
        if (WadRayMath.RAY < params.optimalUsageRatio) {
            revert Errors.InvalidOptimalUsageRate(params.optimalUsageRatio);
        }

        OPTIMAL_USAGE_RATIO    = params.optimalUsageRatio;
        MAX_EXCESS_USAGE_RATIO = WadRayMath.RAY - params.optimalUsageRatio;

        _rate0 = params.rate0;
        _rateSlope1 = params.rateSlope1;
        _rateSlope2 = params.rateSlope2;
    }

    /// @inheritdoc IPoolInterestRateStrategy
    function getRatebase() public view  override returns (uint256) {
        return _rate0;
    }

    /// @inheritdoc IPoolInterestRateStrategy
    function getOptimalUsageRatio() public view  override returns (uint256) {
        return OPTIMAL_USAGE_RATIO;
    }

    /// @inheritdoc IPoolInterestRateStrategy
    function getRateSlope1() public view  override returns (uint256[] memory) {
        return _rateSlope1;
    }

    /// @inheritdoc IPoolInterestRateStrategy
    function getRateSlope2() public view  override returns (uint256[] memory) {
        return _rateSlope2;
    }  

    function getSlopeIndex(uint256 balance) public view returns (uint8) {

        if (balance < BALANCE10000){
            return 0;
        } else if (balance < BALANCE50000){
            return 1;
        } else if (balance < BALANCE500000){
            return 2;
        } else if (balance < BALANCE1000000){
            return 3;
        } else {
            return 4;
        }
    } 

    struct CalcInterestRatesLocalVars {
        uint256 totalPoolBalance;
        uint256 totalDebt;
        uint256 currentBorrowRate;
        uint256 borrowUsageRatio;
        uint256 availableReserveAddTotalDebt;
        uint256 rateSlope1;
        uint256 rateSlope2;
    }

    /// @inheritdoc IPoolInterestRateStrategy
    function calculateInterestRates(
        InterestUtils.CalculateInterestRatesParams memory params
    ) public view override returns (uint256) {

      	CalcInterestRatesLocalVars memory vars;
      	vars.totalDebt = params.totalDebt;
        vars.currentBorrowRate = _rate0;
        vars.rateSlope1 = _rateSlope1[getSlopeIndex(params.totalPoolBalance)];
        vars.rateSlope2 = _rateSlope2[getSlopeIndex(params.totalPoolBalance)];

       //calculate Borrow Rate
      	if (vars.totalDebt != 0){
              vars.totalPoolBalance = params.totalPoolBalance;
        	  vars.availableReserveAddTotalDebt = vars.totalPoolBalance + vars.totalDebt;
        	  vars.borrowUsageRatio = vars.totalDebt.rayDiv(vars.availableReserveAddTotalDebt);
      	}

      	if (vars.borrowUsageRatio > OPTIMAL_USAGE_RATIO){
            uint256 excessBorrowUsageRatio = (vars.borrowUsageRatio - OPTIMAL_USAGE_RATIO).rayDiv(
                MAX_EXCESS_USAGE_RATIO
            );
            vars.currentBorrowRate  += (vars.rateSlope1 + vars.rateSlope2.rayMul(excessBorrowUsageRatio));
      	} else {
        	  vars.currentBorrowRate += vars.rateSlope1
                  .rayMul(vars.borrowUsageRatio)
                  .rayDiv(OPTIMAL_USAGE_RATIO);
      	}

        return vars.currentBorrowRate;

    }

}

