// SPDX-License-Identifier: BUSL-1.1

pragma solidity ^0.8.20;

import "@openzeppelin/contracts/utils/math/SafeCast.sol";
import "hardhat/console.sol";

/**
 * @title Printer
 * @dev Library for console functions
 */
library Printer {
    using SafeCast for int256;
    bool internal constant disablePrinter = false;

    function toString(bytes memory data) public pure returns(string memory) {
        bytes memory alphabet = "0123456789abcdef";

        bytes memory str = new bytes(2 + data.length * 2);
        str[0] = "0";
        str[1] = "x";
        for (uint i = 0; i < data.length; i++) {
            str[2+i*2] = alphabet[uint(uint8(data[i] >> 4))];
            str[3+i*2] = alphabet[uint(uint8(data[i] & 0x0f))];
        }
        return string(str);
    }

    function toString(address account) public pure returns(string memory) {
        return toString(abi.encodePacked(account));
    }

    function toString(uint256 value) public pure returns(string memory) {
        return toString(abi.encodePacked(value));
    }

    function toString(bytes32 value) public pure returns(string memory) {
        return toString(abi.encodePacked(value));
    }

    function log(string memory label) internal pure {
        if (disablePrinter) { return; }
        console.log(
            "%s",
            label
        );
    }

    function log(string memory label, address account) internal pure {
        if (disablePrinter) { return; }
        console.log(
            "%s -%s",
            label,
            toString(account)
        );
    }

    function log(string memory label, bytes32 value) internal pure {
        if (disablePrinter) { return; }
        console.log(
            "%s -%s",
            label,
            toString(value)
        );        
    }

    function log(string memory label, string memory value) internal pure {
        if (disablePrinter) { return; }
        console.log(
            "%s -%s",
            label,
            value
        );        
    }

    // function log(string memory label, uint256 value) internal pure {
    //     console.log(
    //         "%s -%s",
    //         label,
    //         toString(value)
    //     );        
    // }

    function log(string memory label, uint256 value) internal pure {
        if (disablePrinter) { return; }
        console.log(
            "%s -%s",
            label,
            value
        );        
    }


    function log(string memory label, int256 value) internal pure {
        if (disablePrinter) { return; }
        if (value < 0) {
            console.log(
                "%s -%s",
                label,
                (-value).toUint256()
            );
        } else {
            console.log(
                "%s +%s",
                label,
                value.toUint256()
            );
        }
    }
}

